from ImageConversion import Image
import unittest
import base64

class TestImageConversion(unittest.TestCase):
    """
    Unit tests for the image conversion class
    """
    def test_nonstringinput(self):
        """
        This test ensures a TypeError is raised when the class is instantiated with a non-string input parameter
        :return:
        """
        self.assertRaises(TypeError, lambda: Image(input_image=1, thefilename="example.jpg"), 2)

    def test_wrongstringinput(self):
        """
        This test ensures a TypeError is instantiated with a string input parameter that isn't recognized as base64
        :return: True if TypeError raised with input designed to meet TypeError criteria
        """
        self.assertRaises(TypeError, lambda: Image(input_image="", thefilename="example.jpg"), "worth less")

    def test_validinput(self):
        """
        This test ensures an instance of the class can receive a base64 string input parameter
        and return its image in base64 format
        :return:
        """
        imstr = ""
        im = Image(input_image=imstr, thefilename="example.jpg")
        assert im.print64() == imstr

